    {
        type: 'paragraph',
        data: {
            title: 'About this experience',
            content:
              '<p>Ocean Dream Samudra ini diresmikan pada juni 1974 oleh Gubernur Ali Sadikin sebagai perwujudan cita-citanya tentang perlunya sarana rekreasi yang mengenalkan kepada masyarakat tentang laut beserta potensinya. Ocean Dream Samudra merupakan Edutainment Theme Park bernuansa konservasi alam yang memberikan pengalaman untuk mengenal lebih dekat dan menyayangi aneka satwa.Ocean Dream Samudra merupakan unit oceanarium terbesar yang terdiri dari pentas lumba-lumba, pentas singa laut, pentas aneka satwa, peragaan satwa, akuarium ikan laut dan tawar  serta taman yang merupakan habitat beraneka macam burung.Terobosan Ancol ini menjadi pusat studi konservasi ex-situ lumba-lumba (dolphinarium) karena memiliki konsep dan manajemen lumba-lumba yang paling lengkap, meliputi berbagai unsur yang saling mendukung seperti kolam penampungan lumba-lumba, water treatment, trainer/keeper, pengadaan ikan yang berkualitas, laboratorium, para medis dan dokter hewan.</p>',
            preview_max_line: 3,
            preview_max_char: 350,
        }
    }
